import styled from 'styled-components';

const PriceTag = styled.span`
  background: rgba(0, 0, 15, 0.3);
  color: white;
  font-weight: 1000;
  padding: 5px;
  line-height: 1;
  font-size: 3rem;
  display: inline-block;
  position: absolute;
`;

export default PriceTag;
